import React from "react";
import MainPage from "./components/chat/main-page";
import {Provider} from "react-redux";
import store from "./redux/store";
import "./App.css";

class App extends React.Component {
    render() {
        return (
            <Provider store={store}>
                <div className="App">
                    <MainPage/>
                </div>
            </Provider>
        );
    }
}

export default App;
